import React from "react";
import "./Navbar.css";

const NavBar = () =>{
    return (
        <nav className="navBarContainer">
            <h1 className="navBarContentTitle">My Food</h1>
            <ul className="navBarContentLinks">
                <li>Home</li>
                <li>Packages</li>
                <li>About us</li>
                <li>Contact us</li>
                <button>Booking Now</button>
            </ul>
        </nav>
    )
}

export default NavBar;
